import React, { Component } from "react";
import TodoMainTitle from "./TodoMainTitle";

const style = {
  container: {
    width: "30%",
    height: "70vh",
    backgroundColor: "#e6e6e6",
    borderRadius: 10
  }
};

export class TodoContainer extends Component {
  render() {
    return (
      <div style={style.container}>
        <TodoMainTitle />
      </div>
    );
  }
}

export default TodoContainer;
